const ListingThumb = props => {
  return (
    <Row
      style={{ borderColor: "black", borderWidth: "thick", textAlign: "left" }}
    >
      <Col lg={12}>
        <Row>
          <Col>{props.job.jobTitle}</Col>
        </Row>
        <Row>
          <Col>{props.job.company}</Col>
        </Row>
        <Row>
          <Col>{props.job.jobType}</Col>
        </Row>
      </Col>
    </Row>
  );
};

export default ListingThumb;
